import React, { Component } from 'react';
import CreatureDetail from './CreatureDetail.js';
import './Main.css';

const CreatureList = ({ creatures = [] }) => {

  const addCreatureLink = <Route path="/AddCreature" component={AddCreature}></Route>

   const listCreatures = creatures.map((creature, index) => {
      return (
          <li>
            <CreatureDetail
               name={creature.name}
               breed={creature.breed}
               description={creature.description}
            >
            </CreatureDetail>
         </li>
      );
   });
   return (
      <ul>
        {addCreatureLink}
         {listCreatures}
      </ul>
   );

}




   export default CreatureList;
